template<typename T>
ostream &operator<<(ostream &out, const vector<T> &v) {
    out << "{";
    size_t last = v.size() - 1;
    for (size_t i = 0; i < v.size(); ++i) {
        out << v[i];
        if (i != last)
            out << ", ";
    }
    out << "}";
    return out;
}


class Solution {
public:
    int minDominoRotations(vector<int> &A, vector<int> &B) {
        bool dd = false;
        int len = A.size();
        if (len == 1) {
            if (A[0] == B[0]) {
                return 0;
            } else {
                return -1;
            }
        }
        vector<int> mapa(7);
        vector<int> mapb(7);

        int expect = 0;

        map<int, bool> sets;
        sets[A[0]] = true;
        sets[B[0]] = true;
        if (A[0] != B[0]) {
            mapa[A[0]] = 1;
            mapb[B[0]] = 1;
        } else {
            expect = A[0];
        }

        for (int i = 1; i < len; i++) {
            int a = A[i];
            int b = B[i];
            if (expect) {
                if (expect != a && expect != b) {
                    return -1;
                }
                if (a != b) {
                    mapa[a] += 1;
                    mapb[b] += 1;
                }
                continue;
            }
            if (a == b) {
                if (!sets[a]) {
                    return -1;
                } else {
                    expect = a;
                }
            } else {
                if (sets[a] && sets[b]) {
                    mapa[a] += 1;
                    mapb[b] += 1;
                    continue;
                }
                if (!sets[a] && !sets[b]) {
                    return -1;
                }
                if (sets[a]) {
                    expect = a;
                } else {
                    expect = b;
                }
                mapa[a] += 1;
                mapb[b] += 1;
            }
        }

        if (!expect) {
            vector<int> ab(2);
            int count = 0;
            for (auto x : sets) {
                if (x.second) {
                    ab[count] = x.first;
                    count++;
                }
                if (count == 2) {
                    return min(mapa[ab[0]], mapb[ab[1]]);
                }

            }

            return -1;
        }
        return min(mapa[expect], mapb[expect]);
    }
};

class Solution2 {
public:
    int minDominoRotations(vector<int> &A, vector<int> &B) {

        int ans = 0;
        int x = A[0];

        int a = 0, b = 0;

        for (int i = 0; i < A.size(); ++i) {
            if (A[i] != x && B[i] != x) {
                ans = -1;
            } else if (A[i] != x) {
                ++a;
            } else if (B[i] != x) {
                ++b;
            }
        }

        if (ans == -1) {
            x = B[0];
            a = 0;
            b = 0;

            for (int i = 0; i < A.size(); ++i) {
                if (A[i] != x && B[i] != x) {
                    return -1;
                } else if (A[i] != x) {
                    ++a;
                } else if (B[i] != x) {
                    ++b;
                }
            }
        }

        return min(a, b);
    }
};

